import React from 'react';
import './Sidebar.css';

function Sidebar() {
  return (
    <div className="Sidebar">
      <h2>Upcoming Events</h2>
      <div className="event" id="event-feb">
        <div className="event-date">FEB 14</div>
        <div className="event-description">Valentines Chocolate Signup Form</div>
      </div>
      <div className="event" id="event-mar">
        <div className="event-date">MAR 10</div>
        <div className="event-description">Movie Night Signup Form</div>
      </div>
      <div className="event" id="event-apr">
        <div className="event-date">APR 24</div>
        <div className="event-description">Bowling Night Signup Form</div>
      </div>
    </div>
  );
}

export default Sidebar;
